      <header className=' sticky top-0 z-[20] mx-auto flex w-full items-center justify-between border-gray-500 p-8'>

      <Link to="/home"><img src={logoHome} alt="לוגו למסך הבית" width="100px"/></Link>






      </header>



  )
}

export default Navigation

